BEGIN;

DO $$
BEGIN
    IF EXISTS (SELECT 1 FROM information_schema.tables 
               WHERE table_schema = 'public' AND table_name = 'ft_postes') THEN
        RAISE NOTICE 'Table ft_postes already exists. Skipping script.';
    ELSE
	
CREATE EXTENSION IF NOT EXISTS postgis;

SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;

CREATE TABLE "public"."ft_postes" (gid serial,
"ruta" int4,
"km" int4,
"relev_por" varchar(254));
ALTER TABLE "public"."ft_postes" ADD PRIMARY KEY (gid);
ALTER TABLE ft_postes ADD COLUMN geom geometry(POINT, 4326);
CREATE INDEX ON "public"."ft_postes" USING GIST ("geom");
ANALYZE "public"."ft_postes";
END IF;
END
$$;
COMMIT;